/* Procedure structure for procedure `sp_cvd_daily_pos_pri_sec_status_ps` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_cvd_daily_pos_pri_sec_status_ps` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cvd_daily_pos_pri_sec_status_ps`(IN fdate DATE,lftcode INT,rgtcode INT)
BEGIN

SELECT  ps.unit_name psname ,SUM(CASE WHEN st_type='POS' THEN poscnt ELSE 0 END ) AS totpos,
SUM(CASE WHEN st_type='PRI' THEN poscnt ELSE 0 END ) AS totpri,SUM(CASE WHEN st_type='SEC' THEN poscnt ELSE 0 END ) AS totsec 
FROM vw_unit ps LEFT OUTER JOIN (
SELECT ward_id,ps_id,COUNT(per.id) AS poscnt,'POS' AS st_type,c_zone FROM t_cvd_ct_persons per 
WHERE per.status=1  AND decl_date=fdate AND p_type='P' AND per.surveillance_status='Y'
GROUP BY ward_id,ps_id
UNION ALL
SELECT per.ward_id,trace.ps_id,COUNT(trace.person_id) cnt,'PRI' AS st_type,c_zone FROM 
t_cvd_ct_contact_tracing trace LEFT OUTER JOIN t_cvd_ct_persons per ON trace.person_id=per.id
WHERE trace.status=1 AND per.status=1  AND trace.decl_date=fdate 
AND per.p_type='C' AND trace.contact_type='P' AND per.contact_tracing_status=1 AND per.surveillance_status='Y'
GROUP BY per.ward_id,trace.ps_id
UNION ALL
SELECT per.ward_id,trace.ps_id,COUNT(trace.person_id) cnt,'SEC' AS st_type,c_zone FROM 
t_cvd_ct_contact_tracing trace LEFT OUTER JOIN t_cvd_ct_persons per ON trace.person_id=per.id
WHERE trace.status=1 AND per.status=1 AND trace.decl_date=fdate AND per.surveillance_status='Y'
AND per.p_type='C' AND trace.contact_type='S' AND per.contact_tracing_status=1
GROUP BY per.ward_id,trace.ps_id
) a ON ps.id=a.ps_id WHERE ps.lft >=lftcode AND ps.rgt <=rgtcode
GROUP BY ps_id ORDER BY ps.unit_name;
 END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_cvd_daily_stat_tot` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_cvd_daily_stat_tot` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cvd_daily_stat_tot`(IN cdate DATE)
BEGIN
SELECT IFNULL(SUM(IFNULL(npc,0)),0) AS tot_npc,IFNULL(SUM(IFNULL(nphpo,0)),0) AS tot_nphpo,IFNULL( SUM(IFNULL(nphmo,0)),0) AS tot_nphmo,IFNULL(SUM(IFNULL(nfhmo,0)),0) AS tot_nfhmo,IFNULL(SUM(IFNULL(nfhpo,0)),0) AS tot_nfhpo,IFNULL(SUM(IFNULL(t_o,0)),0) AS tot_t_o FROM t_cvd_positive_obs_stat WHERE rdate<=cdate ;
    END */$$
DELIMITER ;

