/* Procedure structure for procedure `loadpalldetails` */

/*!50003 DROP PROCEDURE IF EXISTS  `loadpalldetails` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `loadpalldetails`(
	IN fdate DATE, tdate DATE,lftcode INT,rgtcode INT
)
BEGIN
    
       
	DECLARE finished INTEGER DEFAULT 0;
	DECLARE finished_pri INTEGER DEFAULT 0;
	DECLARE finished_sec INTEGER DEFAULT 0;
	DECLARE counter INTEGER DEFAULT 0;
	DECLARE posid INTEGER DEFAULT 0;DECLARE priid INTEGER DEFAULT 0;DECLARE secid INTEGER DEFAULT 0;
		
	DECLARE curPos CURSOR FOR 
	SELECT t_cvd_ct_persons.id FROM t_cvd_ct_persons LEFT OUTER JOIN vw_unit ps ON t_cvd_ct_persons.ps_id=ps.id
	WHERE decl_date BETWEEN fdate AND tdate AND t_cvd_ct_persons.STATUS=1 AND p_type='P' AND surveillance_status='Y' AND contact_tracing_status=1 AND ps.lft >=lftcode AND ps.rgt <=rgtcode;
					
	-- declare NOT FOUND handler
	DECLARE CONTINUE HANDLER  FOR NOT FOUND SET finished = 1;       			
       
 DROP TEMPORARY TABLE IF EXISTS poslist;
        CREATE TEMPORARY TABLE poslist(
        id INT,decl_date DATE,dmo_id INT,dmo_patient_id VARCHAR(100),dist_name VARCHAR(100),ps_name VARCHAR(100),person_from VARCHAR(100),
        ptype CHAR(3),p_name VARCHAR(100),relation_to VARCHAR(100),age INT ,gender CHAR(1),
		mobile VARCHAR(100),address VARCHAR(250),address_area VARCHAR(100),latitude VARCHAR(50),longitude VARCHAR(50),
		lsg_name VARCHAR(100),ward_name VARCHAR(100),q_location_details VARCHAR(150),q_start_date DATE,c_zone CHAR(5),
		phc VARCHAR(100),symptoms CHAR(1),p_current_status CHAR(1),surveillance_status CHAR(1),
		last_checking_time DATETIME,contact_tracing_status INT,linked_status INT,
			is_negative INT,date_of_negative DATE ,auto_id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY   );   	
	
	OPEN curPos;
	-- REPEAT
	getPos: LOOP
		FETCH curPos INTO posid;
		IF finished = 1 THEN 
			LEAVE getPos;
		END IF;
		
		lsg_name ,ward_name ,q_location_details ,q_start_date ,c_zone,phc ,symptoms,p_current_status,surveillance_status,last_checking_time,contact_tracing_status ,linked_status ,is_negative ,
		date_of_negative,auto_id) 
		SELECT per.id,per.decl_date,per.dmo_id,dmo_patient_id,dist.unit_name dist_name,ps.unit_name ps_name,'' fromName,'POS' ptype,p_name,'',age,gender,
		mobile,address,address_area,latitude,longitude,lsg.lsg_name,w.ward_name,q_location_details,q_start_date,c_zone,
			phc,symptoms,p_current_status,surveillance_status,last_checking_time,contact_tracing_status,linked_status,
			is_negative,date_of_negative,0 
			 FROM t_cvd_ct_persons per LEFT JOIN unit dist ON per.dist_id=dist.id
			 LEFT JOIN vw_unit ps ON per.ps_id=ps.id 
			 LEFT JOIN m_cvd_ct_lsg lsg ON per.lsg_id= lsg.id
			 LEFT JOIN m_cvd_ct_lsg_wards w ON per.ward_id= w.id
			WHERE per.decl_date BETWEEN fdate AND tdate AND per.status=1 AND per.p_type='P' AND ps.lft >=lftcode AND ps.rgt <=rgtcode
			AND per.surveillance_status='Y' AND per.contact_tracing_status=1
			AND per.id=posid ORDER BY per.decl_date ;
				
					
		/* Start Primary Contact Tracing */
		
		BLOCK2: BEGIN	
		BEGIN
			DECLARE curPri CURSOR FOR 
				(SELECT person_id FROM t_cvd_ct_contact_tracing trace  LEFT OUTER JOIN t_cvd_ct_persons per 
				ON trace.person_id=per.id WHERE trace.contact_type='P' AND trace.status=1 
				AND trace.surveillance_status='Y' AND trace.decl_date BETWEEN fdate AND tdate AND 
				per.contact_tracing_status=1 AND per.p_type='C' AND  trace.person_from_id=posid);
				
				DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished_pri = 1;
		
		OPEN curPri;
		REPEAT
		-- getPri: LOOP
		FETCH curPri INTO priid;
		/*IF finished_pri = 1 THEN 
						LEAVE getPri;
		END IF;	*/
		BEGIN
		lsg_name ,ward_name ,q_location_details ,q_start_date ,c_zone,phc ,symptoms,p_current_status,surveillance_status,last_checking_time ,contact_tracing_status ,linked_status ,is_negative ,
		date_of_negative,auto_id) 
		SELECT per.id,per.decl_date,per.dmo_id,per.dmo_patient_id,dist.unit_name dist_name,ps.unit_name ps_name,perpos.p_name AS fromName,'PRI' ptype,
			per.p_name,trace.relation_to,per.age,per.gender,per.mobile,per.address,per.address_area,per.latitude,per.longitude,lsg.lsg_name,wards.ward_name,per.q_location_details,per.q_start_date,per.c_zone,
						per.phc,per.symptoms,per.p_current_status,per.surveillance_status,per.last_checking_time,
			per.contact_tracing_status,per.linked_status,per.is_negative,per.date_of_negative,0 
			FROM t_cvd_ct_persons per LEFT OUTER JOIN t_cvd_ct_contact_tracing trace ON per.id=trace.person_id
			LEFT OUTER JOIN t_cvd_ct_persons perpos ON trace.person_from_id=perpos.id
			LEFT JOIN unit ps ON trace.ps_id=ps.id
			LEFT JOIN unit dist ON trace.dist_id=dist.id
			LEFT JOIN m_cvd_ct_lsg_wards wards ON per.ward_id=wards.id
			LEFT JOIN m_cvd_ct_lsg lsg ON per.lsg_id= lsg.id
			WHERE per.STATUS=1 AND per.p_type='C' AND per.decl_date BETWEEN fdate AND tdate AND per.surveillance_status='Y' AND per.contact_tracing_status=1 
			AND trace.status=1 AND trace.contact_type='P' AND trace.person_id= priid;
			
			END;
			/* Start Secondary Contact Tracing */
		
				BLOCK3: BEGIN	
				BEGIN				
					DECLARE curSec CURSOR FOR 
					SELECT person_id FROM t_cvd_ct_contact_tracing trace  LEFT OUTER JOIN t_cvd_ct_persons per 
				ON trace.person_id=per.id WHERE trace.contact_type='S' AND trace.status=1 
				AND trace.surveillance_status='Y' AND trace.decl_date BETWEEN fdate AND tdate AND 
				per.contact_tracing_status=1 AND per.p_type='C' AND  trace.person_from_id=priid;
				
				DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished_sec = 1;
				
				OPEN curSec;
				REPEAT
			 	FETCH curSec INTO secid;
								
				lsg_name ,ward_name ,q_location_details ,q_start_date ,c_zone,phc ,symptoms,p_current_status,surveillance_status,last_checking_time,contact_tracing_status ,linked_status ,is_negative ,
				date_of_negative,auto_id)  
				SELECT per.id,per.decl_date,per.dmo_id,per.dmo_patient_id,dist.unit_name dist_name,ps.unit_name ps_name,perpos.p_name AS fromName,'SEC' ptype,
				per.p_name,trace.relation_to,per.age,per.gender,per.mobile,per.address,per.address_area,per.latitude,per.longitude,lsg.lsg_name,wards.ward_name,per.q_location_details,per.q_start_date,per.c_zone,
							per.phc,per.symptoms,per.p_current_status,per.surveillance_status,per.last_checking_time,
				per.contact_tracing_status,per.linked_status,per.is_negative,per.date_of_negative,0 
				FROM t_cvd_ct_persons per LEFT OUTER JOIN t_cvd_ct_contact_tracing trace ON per.id=trace.person_id
				LEFT OUTER JOIN t_cvd_ct_persons perpos ON trace.person_from_id=perpos.id
				LEFT JOIN unit ps ON trace.ps_id=ps.id
				LEFT JOIN unit dist ON trace.dist_id=dist.id
				LEFT JOIN m_cvd_ct_lsg_wards wards ON per.ward_id=wards.id
				LEFT JOIN m_cvd_ct_lsg lsg ON per.lsg_id= lsg.id
				WHERE per.STATUS=1 AND per.p_type='C' AND per.decl_date BETWEEN fdate AND tdate AND  per.surveillance_status='Y' AND per.contact_tracing_status=1
				AND trace.status=1 AND trace.contact_type='S' AND trace.person_id= secid AND  trace.person_from_id=priid;
				
			    	UNTIL finished_sec END REPEAT;
				CLOSE curSec;
				END;				
				END BLOCK3;			
					
		 UNTIL finished_pri END REPEAT;
		CLOSE curPri;
		END;
		END BLOCK2;
		/* End Primary Cursor */			
				 -- UNTIL finished END REPEAT;
        END LOOP getPos;
	CLOSE curPos;
	SELECT * FROM poslist GROUP BY id ORDER BY auto_id ASC;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_cvd_daily_pos_pri_sec_status_wards` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_cvd_daily_pos_pri_sec_status_wards` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cvd_daily_pos_pri_sec_status_wards`(IN fdate DATE,lftcode INT,rgtcode INT)
BEGIN
SELECT  ward.ward_name ,SUM(CASE WHEN st_type='POS' THEN poscnt ELSE 0 END ) AS totpos,
SUM(CASE WHEN st_type='PRI' THEN poscnt ELSE 0 END ) AS totpri,
SUM(CASE WHEN st_type='SEC' THEN poscnt ELSE 0 END ) AS totsec 
FROM vw_unit ps 
LEFT OUTER JOIN (
SELECT ward_id,ps_id,COUNT(per.id) AS poscnt,'POS' AS st_type,c_zone FROM t_cvd_ct_persons per 
WHERE per.status=1  AND decl_date=fdate AND p_type='P' AND per.surveillance_status='Y'
GROUP BY ward_id,ps_id
UNION ALL
SELECT per.ward_id,trace.ps_id,COUNT(trace.person_id) cnt,'PRI' AS st_type,c_zone FROM 
t_cvd_ct_contact_tracing trace LEFT OUTER JOIN t_cvd_ct_persons per ON trace.person_id=per.id
WHERE trace.status=1 AND per.status=1  AND trace.decl_date=fdate 
AND per.p_type='C' AND trace.contact_type='P' AND per.contact_tracing_status=1 AND per.surveillance_status='Y'
GROUP BY per.ward_id,trace.ps_id
UNION ALL
SELECT per.ward_id,trace.ps_id,COUNT(trace.person_id) cnt,'SEC' AS st_type,c_zone FROM 
t_cvd_ct_contact_tracing trace LEFT OUTER JOIN t_cvd_ct_persons per ON trace.person_id=per.id
WHERE trace.status=1 AND per.status=1 AND trace.decl_date=fdate AND per.surveillance_status='Y'
AND per.p_type='C' AND trace.contact_type='S' AND per.contact_tracing_status=1
GROUP BY per.ward_id,trace.ps_id
) a ON ps.id=a.ps_id
LEFT OUTER JOIN m_cvd_ct_lsg_wards ward ON a.ward_id=ward.id
WHERE ps.lft >=lftcode AND ps.rgt <=rgtcode AND ward_name IS NOT NULL
GROUP BY ward_id ORDER BY ward.ward_name;

 END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_cvd_daily_stat` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_cvd_daily_stat` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cvd_daily_stat`(IN cdate DATE)
BEGIN
SELECT pre.distid,unit.unit_name,
IFNULL(pre.pnpc,0) pnpc,IFNULL(cur.npc,0) npc,SUM(IFNULL(pre.pnpc,0)+IFNULL(cur.npc,0)) AS tot_npc,
IFNULL(pre.pnphpo,0) pnphpo,IFNULL(cur.nphpo,0) nphpo,SUM(IFNULL(pre.pnphpo,0)+IFNULL(cur.nphpo,0)) AS tot_nphpo,
IFNULL(pre.pnphmo,0) pnphmo,IFNULL(cur.nphmo,0) nphmo ,SUM(IFNULL(pre.pnphmo,0)+IFNULL(cur.nphmo,0)) AS  tot_nphmo,
IFNULL(pre.pnfhmo,0) pnfhmo,IFNULL(cur.nfhmo,0) nfhmo,SUM(IFNULL(pre.pnfhmo,0)+IFNULL(cur.nfhmo,0)) AS tot_nfhmo,
IFNULL(pre.pnfhpo,0) pnfhpo,IFNULL(cur.nfhpo,0) nfhpo,SUM(IFNULL(pre.pnfhpo,0)+IFNULL(cur.nfhpo,0)) AS tot_nfhpo,
IFNULL(pre.pt_o,0) pt_o,IFNULL(cur.t_o,0) t_o , SUM(IFNULL(pre.pt_o,0)+IFNULL(cur.t_o,0) ) AS tot_t_o,IFNULL(cur.action_taken,'') action_taken
FROM(
SELECT distid,SUM(npc) AS pnpc,SUM(nphpo) AS pnphpo, SUM(nphmo) AS pnphmo,SUM(nfhmo) AS pnfhmo,
SUM(nfhpo) AS pnfhpo,SUM(t_o) AS pt_o FROM t_cvd_positive_obs_stat WHERE rdate<cdate 
GROUP BY distid) pre LEFT JOIN (
SELECT distid,npc,nphpo,nphmo,nfhmo,nfhpo,t_o,action_taken FROM t_cvd_positive_obs_stat WHERE rdate=cdate 
) cur ON pre.distid=cur.distid LEFT  JOIN unit ON pre.distid=unit.id AND unit.idunittype=11 
GROUP BY pre.distid,unit.unit_name ORDER BY unit.list_order;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_cvd_daily_stat_dist` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_cvd_daily_stat_dist` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cvd_daily_stat_dist`(IN cdate DATE, dist_code INT)
BEGIN
SELECT pre.distid,unit.unit_name,
IFNULL(pre.pnpc,0) pnpc,IFNULL(cur.npc,0) npc,SUM(IFNULL(pre.pnpc,0)+IFNULL(cur.npc,0)) AS tot_npc,
IFNULL(pre.pnphpo,0) pnphpo,IFNULL(cur.nphpo,0) nphpo,SUM(IFNULL(pre.pnphpo,0)+IFNULL(cur.nphpo,0)) AS tot_nphpo,
IFNULL(pre.pnphmo,0) pnphmo,IFNULL(cur.nphmo,0) nphmo ,SUM(IFNULL(pre.pnphmo,0)+IFNULL(cur.nphmo,0)) AS  tot_nphmo,
IFNULL(pre.pnfhmo,0) pnfhmo,IFNULL(cur.nfhmo,0) nfhmo,SUM(IFNULL(pre.pnfhmo,0)+IFNULL(cur.nfhmo,0)) AS tot_nfhmo,
IFNULL(pre.pnfhpo,0) pnfhpo,IFNULL(cur.nfhpo,0) nfhpo,SUM(IFNULL(pre.pnfhpo,0)+IFNULL(cur.nfhpo,0)) AS tot_nfhpo,
IFNULL(pre.pt_o,0) pt_o,IFNULL(cur.t_o,0) t_o , SUM(IFNULL(pre.pt_o,0)+IFNULL(cur.t_o,0) ) AS tot_t_o,IFNULL(cur.action_taken,'') action_taken
FROM(
SELECT distid,SUM(npc) AS pnpc,SUM(nphpo) AS pnphpo, SUM(nphmo) AS pnphmo,SUM(nfhmo) AS pnfhmo,
SUM(nfhpo) AS pnfhpo,SUM(t_o) AS pt_o FROM t_cvd_positive_obs_stat WHERE rdate<cdate AND distid=dist_code
GROUP BY distid) pre LEFT JOIN (
SELECT distid,npc,nphpo,nphmo,nfhmo,nfhpo,t_o,action_taken FROM t_cvd_positive_obs_stat WHERE rdate=cdate AND distid=dist_code
) cur ON pre.distid=cur.distid LEFT  JOIN unit ON pre.distid=unit.id AND unit.idunittype=11 
GROUP BY pre.distid,unit.unit_name;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_cvd_quar_check_ps_daily` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_cvd_quar_check_ps_daily` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cvd_quar_check_ps_daily`(IN fdate DATE,lftcode INT,rgtcode INT)
BEGIN
	SELECT trace.ps_id,ps.unit_name AS psname,COUNT(trace.id) totprimary,IFNULL(totcnt,0) AS chked
	 FROM  t_cvd_ct_contact_tracing trace LEFT OUTER JOIN 
	 (
	 SELECT ps_id,COUNT(pesron_id) AS totcnt FROM (
	SELECT DISTINCT pesron_id,dist_id,ps_id
	FROM t_cvd_ct_q_check t1
	WHERE date_time_checking = (SELECT MAX(date_time_checking) FROM t_cvd_ct_q_check WHERE id = t1.id 
	AND DATE(date_time_checking)=DATE(t1.date_time_checking)) AND DATE(t1.date_time_checking)=fdate) chk_tot 
	GROUP BY ps_id
	 ) che ON  trace.ps_id=che.ps_id 
	 LEFT OUTER JOIN vw_unit ps ON trace.ps_id=ps.id 
	LEFT JOIN t_cvd_ct_persons per ON trace.person_id=per.id
	 WHERE trace.surveillance_status='Y' AND trace.status=1 AND trace.contact_type='P' AND per.p_type='C'
	 AND ps.lft >=lftcode AND ps.rgt <=rgtcode AND trace.ps_id>0 AND per.contact_tracing_status=1 AND trace.decl_date<=fdate
	 GROUP BY trace.ps_id ORDER BY psname;
    END */$$
DELIMITER ;

